import React from "react";
import { useHistory } from "react-router-dom";

function Header() {
  let history = useHistory();
  function handleClick2() {
    history.push("all-recipes");
  }

  return (
    <div>
      <h1>Header</h1>
      <button onClick={handleClick2}>All Recipes</button>
    </div>
  );
}
export default Header;
